import React, { useState,useEffect } from "react";
import axios from "axios";
import { Link,useParams,useNavigate } from "react-router-dom";
import SellerNav from "../Navbar/navbar";
export default function SellerHome(props){
   const {username, user_id } = useParams();
   const [orders,setOrders]=useState([])
   const navigate = useNavigate();
   useEffect(() => {
        getOrders();
    }, []);

    const getOrders = async () => {
        const response = await axios.get(`http://localhost:5000/orders_by_seller/${user_id}`);
        setOrders(response.data)
        console.log(response.data)
    };

    return(
      <div>
      <SellerNav/>
      {
         orders.map((order)=>{
            <div className='product-entry-body'>
            <div className='product-entry-card'>
                  <div className='product-entry-content'>
                     <p className='product-entry-description'><b>orderID</b></p>
                     <p className='product-entry-description'>{order._id} </p>
                  </div>
                  <div className='product-entry-content'>
                     <p className='product-entry-description'><b>Status</b> </p>
                     <p className='product-entry-description'>Quantity </p>
                  </div>
                  <div className='product-buttons'>
                     <button className='product-button' >Modify</button>
                  </div>
            </div>
            </div>
         })
      }

   </div>
    );
}
